```
set key=HKLM\SOFTWARE\Microsoft\Windows NT\CurrentVersion
for /F "usebackq tokens=1,2*" %%i in (`reg query "%key%" /V ProductName`) do (
   if /i "%%i" equ "ProductName" (
      set winVersion=%%k
)  ) 
```

